import React, { Component } from 'react'
import Navbarmenu from "./Navbarmenu"


export default class Home extends Component {
    render() {
        return (
            <section style={Pagestyle}>
                <Navbarmenu />
                hello from HOme page 
            </section>
        )
    }
}
const Pagestyle = {
    background:"#000",
    height:"100vh"
}
